  if (number.value <= 9) {
    store.value=number.value * state.value;
  }
  output+=(String.format("%d\n",store.value));
  number.value=number.value / 10;
  i.value++;
  if (number.value == 0) {
    output+=(String.format("That's all, have a nice day!\n"));
    break;
  }
}
